import React from 'react';
import { Link } from 'react-router-dom';

function Nav({dogs}){
    return(
        <nav>
            <link to="/dogs">Home</link>
            {dogs.map(dog => (
                <link to={`/dogs/${dog.name.toLowerCase()}`}>{dog.name}</link>
            ))}
        </nav>
    );
}

export default Nav;
